import '../css/Profile.css';
import '../css/style.css';

export default function About() {


    return (
        <div className = "profile-section">
            <div className = "description-box">
                <div className="section-title">About</div>
                <div className = "entry-desc">I am currently a senior at Carnegie Mellon University studying at the intersection of design, computer science, behavioral science, and statistics. My specific area of interest is in the development and design of music streaming platforms. </div>
                <div className = "contact">
                    <img className = "contact-image" src = "./content/Images-Profile/mail.png"/>
                    <div className = "entry-desc">eamonnpame@gmail.com</div>
                </div>
            </div>

        </div>

    );

};
